import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import CardMedia from "@material-ui/core/CardMedia";
import CardContent from "@material-ui/core/CardContent";
import { makeStyles } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "1rem",
    paddingTop: "5rem",
    display: "flex",
    flexDirection: "column",
    flexBasis: "50%",
  },
  header: {
    textAlign: "center",
  },
  media: {
    height: "18rem",
    width: "100%",
  },
  content: {
    display: "flex",
    flexDirection: "column",
  },
  rowCont: {
    display: "flex",
    justifyContent: "space-between",
  },
  subCont: {
    width: "50%",
    paddingLeft: "0.5rem",
  },
  league: {
    textAlign: "center",
    paddingTop: "1rem",
  },
}));
var Cards = (props) => {
  const classes = useStyles();
  return (
    <Card className={classes.root}>
      <CardHeader className={classes.header} title={props.name} />
      <CardMedia className={classes.media} image={props.flag} />
      <CardContent className={classes.content}>
        <div className={classes.rowCont}>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Capital:{props.capital}
            </Typography>
          </div>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Region:{props.region}
            </Typography>
          </div>
        </div>
        <div className={classes.rowCont}>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Sub Region:{props.subRegion}
            </Typography>
          </div>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Population:{props.population}
            </Typography>
          </div>
        </div>
        <div className={classes.rowCont}>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Area:{props.area} km
            </Typography>
          </div>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Borders:
              {props.borders.map((i) => {
                return <span> {i},</span>;
              })}
            </Typography>
          </div>
        </div>
        <div className={classes.rowCont}>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Native name: {props.nativeName}
            </Typography>
          </div>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              languages:
              {props.languages.map((i) => {
                return <span> {i.name},</span>;
              })}
            </Typography>
          </div>
        </div>
        <div className={classes.rowCont}>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Calling Codes:
              {props.callingCode.map((i) => {
                return <span> {i},</span>;
              })}
            </Typography>
          </div>
          <div className={classes.subCont}>
            <Typography variant="body2" color="initial">
              Regional Blocks:
              {props.regionalBlocks.map((i) => {
                return <span> {i.name},</span>;
              })}
            </Typography>
          </div>
        </div>
      </CardContent>
    </Card>
  );
};
export default Cards;
